import React from "react";

function AboutUs() {
  return (
    <div className="about-us-body">
      <style>
        {`
          .about-us-body {
            display: flex;
            font-family: Helvetica, sans-serif;
            margin: 0;
            padding: 0;
            flex-direction: column;
            align-items: center;
            color: #333;
          }

          .container-about-us {
            width: 80%;
            max-width: 1000px;
            text-align: center;
          }

          .mission {
            margin: 20px 0;
            padding: 20px;
            background-color: #f4f4f4;
            border-radius: 8px;
          }

          .team {
            display: flex;
            flex-wrap: wrap;
            gap: 20px;
            justify-content: center;
          }

          .team-member {
            width: 150px;
            text-align: center;
          }

          .team-member img {
            width: 120px;
            height: 120px;
            border-radius: 50%;
            object-fit: cover;
            border: 2px solid #ddd;
          }

          .team-member h3 {
            font-size: 1.2em;
            margin: 10px 0 5px;
          }

          .team-member a {
            color: #0077b5;
            text-decoration: none;
            font-size: 0.9em;
          }
        `}
      </style>
      <div className="container-about-us">
        <h1 className="about-us-h1">About Us</h1>

        {/* Mission Section */}
        <section className="mission">
          <h2 className="about-us-h2">Our Mission</h2>
          <p>
            Postpartum depression is a serious mental health condition that
            affects approximately 13% of mothers globally. In developing
            countries, this number rises to almost 20%. It can have severe
            consequences for both the mother and the child, impacting bonding,
            child development, and overall family well-being. This application is
            designed to support mothers experiencing postpartum depression by
            providing tools for mood tracking, self-assessment, community support,
            and access to educational resources.
          </p>
        </section>

        {/* Team Section */}
        <h2>Meet the Team</h2>
        <section className="team">

          {/* Team Member 1 */}
          <div className="team-member">
            <img src="/images/safa_picture.jpeg" alt="Team Member 1" />
            <h3>Safa Jamal</h3>
            <p>UX Designer + Front-end Developer</p>
            <a href="https://www.linkedin.com/in/safa-jamal/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          </div>

          {/* Team Member 2 */}
          <div className="team-member">
            <img src="/images/joey_picture.jpeg" alt="Team Member 2" />
            <h3>Joey Kang</h3>
            <p>Backend Developer</p>
            <a href="https://www.linkedin.com/in/joey--kang/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          </div>

          {/* Team Member 3 */}
          <div className="team-member">
            <img src="/images/mynah_picture.jpeg" alt="Team Member 3" />
            <h3>Mynah Shetty</h3>
            <p>Front-end Developer</p>
            <a href="https://www.linkedin.com/in/mynahshetty/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          </div>

          {/* Team Member 4 */}
          <div className="team-member">
            <img src="/images/mira_picture.jpeg" alt="Team Member 4" />
            <h3>Mira Nair</h3>
            <p>Front-end Developer</p>
            <a href="https://www.linkedin.com/in/miranair/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          </div>

          {/* Team Member 5 */}
          <div className="team-member">
            <img src="/images/katie_picture.jpeg" alt="Team Member 5" />
            <h3>Katie Shi</h3>
            <p>Front-end Developer</p>
            <a href="https://www.linkedin.com/in/katie-shi-ab4973185/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          </div>

        </section>
      </div>
    </div>
  );
}

export default AboutUs;
